"use strict";(self.webpackChunkstudywithme=self.webpackChunkstudywithme||[]).push([[980],{5837:n=>{n.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"/first-page","metadata":{"permalink":"/studywithme/blog/first-page","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/first-page.md","source":"@site/blog/first-page.md","title":"Welcome to my note \ud83d\udc38","description":"_\\"L\u1eddi n\xf3i \u0111\u1ea7u ti\xean, t\xf4i xin c\u1ea3m \u01a1n c\xe1c b\u1ea1n \u0111\xe3 d\xe0nh th\u1eddi gian gh\xe9 th\u0103m trang web c\u1ee7a t\xf4i. \ud83d\ude4f\ud83c\udffc\\"","date":"2025-02-27T18:06:07.000Z","tags":[],"readingTime":2.485,"hasTruncateMarker":false,"authors":[],"frontMatter":{"tittle":"Study with me","sidebar_position":1},"unlisted":false},"content":"> _\\"L\u1eddi n\xf3i \u0111\u1ea7u ti\xean, t\xf4i xin c\u1ea3m \u01a1n c\xe1c b\u1ea1n \u0111\xe3 d\xe0nh th\u1eddi gian gh\xe9 th\u0103m trang web c\u1ee7a t\xf4i. \ud83d\ude4f\ud83c\udffc\\"\\n\\n## M\u1ed9t ch\xfat v\u1ec1 t\xf4i \ud83e\udee3\\n\\n| C\xf3 l\u1ebd ng\u01b0\u1eddi xem \u0111\u01b0\u1ee3c c\xe1i n\xe0y c\u0169ng bi\u1ebft s\u01a1 ch\xfat v\u1ec1 t\xf4i r\u1ed3i, nh\u01b0ng t\xf4i v\u1eabn xin gi\u1edbi thi\u1ec7u l\u1ea1i. T\xean \u0111\u1ea7y \u0111\u1ee7  **Tr\u1ea7n Tu\u1ea5n Anh** sinh nh\u1eadt **24/04/2004**, hi\u1ec7n \u0111ang l\xe0 sinh vi\xean ng\xe0nh **An To\xe0n Th\xf4ng Tin** t\u1ea1i **UIT-VNUHCM**. Trang note n\xe0y \u0111\u01b0\u1ee3c t\u1ea1o ra v\u1edbi m\u1ee5c \u0111\xedch l\xe0 ghi ch\xfa l\u1ea1i nh\u1eefng ki\u1ebfn th\u1ee9c m\xe0 t\xf4i h\u1ecdc \u0111\u01b0\u1ee3c v\xe0 chia s\u1ebb cho nh\u1eefng ai c\u1ea7n. V\xe0 m\u1ee5c ti\xeau t\xf4i \u0111ang h\u01b0\u1edbng t\u1edbi l\xe0 t\u1ed1t nghi\u1ec7p \u0111\xfang h\u1ea1n, c\xf2n v\u1ec1 vi\u1ec7c l\xe0m th\xec t\xf4i v\u1eabn ch\u01b0a qu\xe1 r\xf5 r\xe0ng. | ![picture](../static/img/docusaurus.png)  |\\n| ---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------- | ----------------------------------------- |\\n\\n### M\u1ed9t s\u1ed1 s\u1edf th\xedch c\xe1 nh\xe2n \ud83c\udfae\\n\\n#### Nh\u1ea1c \ud83c\udfb5\\n\\n- **M\u1ed9t s\u1ed1 lo\u1ea1i \xe2m nh\u1ea1c t\xf4i th\xedch nghe:** `nh\u1ea1c chill`, `nh\u1ea1c edm`, ...\\n\\n- **M\u1ed9t s\u1ed1 t\xe1c gi\u1ea3 t\xf4i th\xedch nghe:** [\u0110en V\xe2u](https://www.youtube.com/@DenVau1305), [Justin Bieber](https://www.youtube.com/@justinbieber)\\n\\n#### Tr\xf2 ch\u01a1i \ud83c\udfae\\n\\nT\xf4i ch\u01a1i kh\xe1 nhi\u1ec1u nh\u01b0ng c\u0169ng ch\u1ec9 \u0111\u1ec3 gi\u1ea3i tr\xed.\\n\\n#### Th\u1ec3 thao \ud83c\udfc5\\n\\nH\u1ea7u nh\u01b0 t\xf4i ch\u1ec9 ch\u01a1i `c\u1ea7u l\xf4ng`, `b\xf3ng \u0111\xe1` v\u1edbi t\u1ea7n s\u1ed1 kh\xe1 \xedt (c\u1ea7n c\u1ea3i thi\u1ec7n).\\n\\n#### Vi\u1ebft l\xe1ch \u2712\ufe0f\\n\\nT\xf4i t\u1eebng th\u1eed vi\u1ebft v\xe0i cu\u1ed1t truy\u1ec7n vui nh\u01b0ng k\u1ebft qu\u1ea3 l\xe0 kh\xf4ng \u0111\u01b0\u1ee3c nhi\xeau ch\u01b0\u01a1ng v\xe0 drop :>\\n\\n#### \u0110\u1ed3 u\u1ed1ng \u01b0a th\xedch:\\n\\n\ud83c\udf75 Coffe, \ud83c\udf75 tr\xe0, ...\\n\\nV\xe0 t\xf4i th\u01b0\u1eddng u\u1ed1ng cafe v\xe0i l\u1ea7n trong tu\u1ea7n, n\xf3 nh\u01b0 m\u1ed9t th\xf3i quen s\u1ed1ng c\u1ee7a t\xf4i v\u1eady @@\\n\\n### M\u1ed9t s\u1ed1 topic m\xe0 t\xf4i mu\u1ed1n h\u01b0\u1edbng t\u1edbi \ud83e\uddd1\ud83c\udffc\u200d\ud83d\udcbb\\n\\nTr\u01b0\u1edbc ti\xean s\u1ebd l\xe0 m\u1ed9t s\u1ed1 topic \u0111\u01a1n gi\u1ea3n cho nh\u1eefng ai h\u1ecdc v\u1ec1 IT, nh\u01b0 l\xe0 c\xe1ch d\xf9ng Git, m\u1ed9t s\u1ed1 th\xf4ng tin v\u1ec1 Malware, m\u1ed9t s\u1ed1 l\u1ed7i b\u1ea3o m\u1eadt, ... Sau \u0111\xf3 l\xe0 c\xe1c ph\u1ea7n t\xf4i t\u1ef1 h\u1ecdc v\xe0 t\xf3m t\u1eaft b\u1edfi c\xe1c kh\xf3a h\u1ecdc m\xe0 t\xf4i t\xecm h\u1ecdc li\xean quan \u0111\u1ebfn **Network** v\xe0 **Cybersecurity**.\\n\\n### M\u1ed9t s\u1ed1 k\u1ef9 n\u0103ng t\xf4i c\xf3 \ud83d\udc40\\n\\n`C\xe1i n\xe0y th\xec kh\xf4ng qu\xe1 nhi\u1ec1u, nh\u01b0ng sau \u0111\xe2y l\xe0 m\u1ed9t s\u1ed1 k\u1ef9 n\u0103ng m\xe0 t\xf4i h\u1ecdc \u0111\u01b0\u1ee3c trong su\u1ed1t th\u1eddi gian qua:`\\n\\n- **Programing:** `C++`, `Assembly Intel x86`\\n\\n- **Tools:** `Wireshark`, `GDP(Linux)`, ...\\n\\n- **Certificates:** `Ielts(5.5)`\\n\\n### M\u1ed9t s\u1ed1 \u0111\u1ed3 \xe1n m\xe0 t\xf4i \u0111\xe3 l\xe0m v\xe0 tham gia \u2712\ufe0f\\n\\n`Ch\u1ea5t l\u01b0\u1ee3ng \u0111\u1ed3 \xe1n ch\u1ec9 n\u1eb1m trong ph\u1ea1m vi m\xf4n h\u1ecdc: `\\n\\n|**\u0110\u1ed3 \xe1n**                             |**Mi\xeau t\u1ea3**                                                         |**Vai tr\xf2**                                     |**Links Github**              |\\n|--------------------------------------|--------------------------------------------------------------------|------------------------------------------------|------------------------------|\\n|\u1ee8ng d\u1ee5ng \u0111\u1ecdc truy\u1ec7n                   |M\u1ed9t \u1ee9ng d\u1ee5ng \u0111\u1ecdc truy\u1ec7n d\u1ef1a tr\xean trang webtoon                      |Th\xe0nh vi\xean                                      |--                            |\\n|Poly Fuzz: Holistic Greybox Fuzzing of Multi-Language Systems|PolyFuzz s\u1eed d\u1ee5ng c\u01a1 ch\u1ebf ph\u1ea3n h\u1ed3i coverage feedback gi\u1eefa c\xe1c ng\xf4n ng\u1eef v\xe0 m\xf4 h\xecnh h\xf3a m\u1ed1i quan h\u1ec7 ng\u1eef ngh\u0129a gi\u1eefa c\xe1c \u0111\u1ea7u v\xe0o (inputs) v\xe0 c\xe1c \u0111i\u1ec1u ki\u1ec7n r\u1ebd nh\xe1nh (branch predicates). |Th\xe0nh vi\xean|--|\\n\\n### Kinh nghi\u1ec7m vi\u1ec7c l\xe0m \ud83e\udd37\ud83c\udffc\u200d\u2642\ufe0f\\n\\n**Ch\u01b0a c\xf3**\\n\\n### Th\xf4ng tin li\xean h\u1ec7 \ud83d\udc81\ud83c\udffc\u200d\u2642\ufe0f\\n\\n- **Facebook:** [Tran Tuan Anh](https://www.facebook.com/ta.zek.k4/)\\n\\n- **S\u1ed1 \u0111i\u1ec7n tho\u1ea1i:** 0389 219 504\\n\\n- **Email(tr\u01b0\u1eddng):** [22520080@gm.uit.edu.vn](22520080@gm.uit.edu.vn)\\n\\n- **Email(c\xe1 nh\xe2n):** [anhtuantranpt244@gmail.com](anhtuantranpt244@gmail.com)\\n\\n- **Github:** [tuananh244](https://github.com/tuananh244)"}]}}')}}]);